INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(279384, 'esES', 'Competición de demolición del Pez Hondo', 'Competición de demolición del Pez Hondo', 59888),
(279845, 'esES', 'No...', '', 59888),
(275804, 'esES', '¿Tienes idea de cuánto cuesta ese trasto? ¡Me lo voy a cobrar de tu pellejo verde, Gazlowe!', '', 59888),
(268880, 'esES', '¡Ver a mi capitán haciendo las cosas bien me llena de orgullo! ¡Que le den al botín de Gallywix!', '', 59888),
(271175, 'esES', '', 'Pero me lo estaba pasando bien...', 59888),
(271159, 'esES', '', '¡Mi paquete ejecutivo! ¡Os haré lo mismo que a vuestro amiguito Renzik!', 59888),
(268888, 'esES', '¡La sangre negra es del jefe Gallywix!', '', 59888),
(268887, 'esES', '¡Ya nos encargamos nosotros de la carga!', '', 59888),
(275706, 'esES', '¡Te sacude los huesos!', '', 59888),
(275703, 'esES', '¿Cuánto calor aguanta la carne antes de asarse?', '', 59888),
(275100, 'esES', '¡Me toca! Los haré polvo.', '', 59888),
(275029, 'esES', '¡Os haré papilla!', '', 59888),
(274595, 'esES', '¡Quien apuesta, gana!', '', 59888),
(275947, 'esES', 'Soy el último jefe de vuestras vidas.', '', 59888),
(275944, 'esES', '¡Me debéis una, peleles!', '', 59888),
(275943, 'esES', '¡Eh! ¡Adelante!', '', 59888),
(282252, 'esES', 'Es Zumbacarreta, señoría. Abogado de oficio Zumbacarreta.', '', 59888),
(282250, 'esES', 'Es la verdad, señoría. Y si se me permite, me gustaría contar la historia de esta ley dado que es relevante para el contexto...', '', 59888),
(282246, 'esES', 'Señoría. El Gallagio ya tiene dueño.', '', 59888),
(282244, 'esES', 'Es sencillo, señoría. El propietario está muerto. ¡Ese establecimiento DEBE salir a subasta!', '', 59888),
(281492, 'esES', 'Y Marty Zumbacarreta está preparado. Eso es todo, señoría.', '', 59888),
(281491, 'esES', 'Tarbonara Sisamanivela está preparado, dispuesto y respetuosamente honrado, señoría.', '', 59888),
(276966, 'esES', 'También ha puesto cangrejos bomba por todo el tribunal, señoría. $p los ha desactivado.', '', 59888),
(276963, 'esES', 'Señoría, ¡es evidente! El asesino solo ha podido ser... ¡$p!', '', 59888),
(276962, 'esES', 'Señoría, ¡tenemos pruebas de que el asesino de Pimpollo Gallywix se encuentra hoy en este tribunal!', '', 59888),
(280948, 'esES', '', '¿Quieres algo de papeo? ¿Qué me dices de un Torq para llevar? ¡Es lo más exclusivo que se puede comprar con dinero! Además, este en concreto no destroza gente ni pequeños establecimientos.\n\nEs que eso ha sido un problema en el pasado...', 59888),
(280946, 'esES', 'Aún estoy arreglando los errores. Esta revolución me tiene demasiado estimulado.\n\n¿Quieres probar el modelacaras de Facetador? ¡Te va a dejar mejor que cuando naciste!', '', 59888),
(280940, 'esES', 'Bueno, bueno, bueno... ¿Quieres participar en mi operación? Lo siento, coleguita, nadie está satisfecho con una sola pieza. Reúne más dinero y tal vez puedas hacer negocios con un tipo como yo.', '', 59888),
(280939, 'esES', 'La recepción acaba de llamar al jefe y ha dicho que tus amigos y tú podéis pasar... si tenéis suficiente experiencia. ¿Sabes qué? Demuéstrame que eres capaz de derrotar a Mug\'Zee, y te llevaré al cuarto trasero cuando quieras, colega.\n\nTu lealtad significa mucho para El Gallagio. ¡Incluso si destrozas el lugar!', '', 59888),
(280933, 'esES', 'El jefe dice que no debo contarles a los desconocidos que tenemos armas falsificadas, que no son reales, porque es más fácil vendérselas a los turistas si piensan que SÍ lo son.\n\nAsí que no se lo digas a nadie. Y menos a los desconocidos.', '', 59888),
(280080, 'esES', '<gritos de enfado> ', '', 59888),
(279822, 'esES', '', 'Nos vemos al otro lado, Gazzy.', 59888),
(275813, 'esES', 'Alguien está de mal humor. ¿Quieres desbancarme? Sigue así. Pronto nos veremos las caras.', '', 59888),
(275810, 'esES', '¡Y vosotros no tenéis permiso! ¿A que sí, Mug?', '', 59888),
(275777, 'esES', '¡Eureka! ¡Gallywix se va a volver loco cuando vea esto! O no. Mmm. Quizá debería hacer unas pruebas de mercado antes.', '', 59888),
(275363, 'esES', '', '¡Se acabó!', 59888),
(275239, 'esES', 'Volveremos después de estos... eh... ¡anuncios!', '', 59888);
