(2640, 'esES', 'Caldera de la Carnicería', 'A lo largo de la historia se han sucedido muchas guerras de proporciones épicas, pero ninguna tan explosiva como la rivalidad que existe entre el gorila galvánico Torq la Tormenta y el mecasaurio fundido Flarendo el Furioso. Esta noche no faltarán las apuestas, ya que estos dos campeones se enfrentarán en la caldera para dar un espectáculo que amenaza con partir Minahonda por la mitad. Presencia la matanza o quedarás fatal ante los goblins.', 59888);
