(31438, 'esES', 'Sección 29', '', 59888),
(30331, 'esES', 'Resumen', 'Flarendo y Torq, decididos a dar un gran espectáculo al público, lanzan |cFF2959D3|Hspell:473650|h[Bomba chatarra]|h|r varias veces y atacan a los combatientes de la arena con |cFF2959D3|Hspell:473951|h[Carga estática]|h|r.\n¡Al llegar a 100 p. de energía, Flarendo y Torq se enfrentan en un |cFF2959D3|Hspell:465833|h[Choque colosal]|h|r!', 59888),
(27555, 'esES', 'Sanadores', '$bullet;Al agotarse, |cFF2959D3|Hspell:424739|h[Corrupción caótica]|h|r estalla y salta hasta el jugador más cercano.\n$bullet;|cFF2959D3|Hspell:424739|h[Corrupción caótica]|h|r inflige daño periódico moderado a su objetivo actual.\n$bullet;|cFF2959D3|Hspell:425052|h[Gravedad oscura]|h|r inflige daño moderado a todos los jugadores mientras dura.', 59888),
(30489, 'esES', 'DPS', '$bullet;Los |cFF2959D3|Hspell:465952|h[Montonazos de bombas enormes]|h|r y la |cFF2959D3|Hspell:1214607|h[Gran tromba de explosiones]|h|r activan |cFF2959D3|Hspell:466158|h[Bolsa de zapador]|h|r y |cFF2959D3|Hspell:1214755|h[Cohetes sobrecargados]|h|r.\n$bullet;Al morir, los técnicos de Fundisombras dejan caer unas gigabombas que activan |cFF2959D3|Hspell:1223905|h[¡Giga-BUM!]|h|r tras $1223905D. La |cFF2959D3|Hspell:469327|h[Gigaexplosión]|h|r de Gallywix las detona al instante.\nLas $bullet;|cFF2959D3|Hspell:469362|h[Gigabombas cargadas]|h|r que se llevan a los gigacontroles activan una |cFF2959D3|Hspell:469767|h[Detonación de gigabomba]|h|r, lo que a su vez activa un |cFF2959D3|Hspell:1220846|h[Fallo de controles]|h|r e interrumpe las |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r de Gallywix.\n$[15,16$bullet;El centinela tirador puede infligir una gran cantidad de daño con |cFF2959D3|Hspell:466834|h[Ráfaga de descargas]|h|r cuando no se le controla.$]', 59888),
(30488, 'esES', 'Sanadores', '$bullet;El jugador afectado por |cFF2959D3|Hspell:1220761|h[Botes del ingeniero mecánico]|h|r explota cuando se consume o se agota, lo que provoca una |cFF2959D3|Hspell:474447|h[Detonación de bote]|h|r.\n$bullet;Al morir, los técnicos de Fundisombras dejan caer unas gigabombas que activan |cFF2959D3|Hspell:1223905|h[¡Giga-BUM!]|h|r tras $1223905D. La |cFF2959D3|Hspell:469327|h[Gigaexplosión]|h|r de Gallywix las detona al instante.\n$bullet;Las |cFF2959D3|Hspell:469362|h[Gigabombas cargadas]|h|r que se llevan a los gigacontroles activan una |cFF2959D3|Hspell:469767|h[Detonación de gigabomba]|h|r, lo que a su vez activa un |cFF2959D3|Hspell:1220846|h[Fallo de controles]|h|r e interrumpe las |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r de Gallywix.\n$bullet;Las |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r, los |cFF2959D3|Hspell:466338|h[Cohetes acelerados]|h|r y |cFF2959D3|Hspell:1214369|h[¡¡DESTRUCCIÓN TOTAL!!]|h|r infligen un daño considerable.', 59888),
(30487, 'esES', 'Tanques', '$[15,16$bullet;Los |cFF2959D3|Hspell:465952|h[Montonazos de bombas enormes]|h|r y la |cFF2959D3|Hspell:1214607|h[Gran tromba de explosiones]|h|r también crean un |cFF2959D3|Hspell:466165|h[Torpedo de fogueo]|h|r.$]\n$bullet;Los |cFF2959D3|Hspell:466340|h[Botes de dispersión]|h|r y la |cFF2959D3|Hspell:1214607|h[Gran tromba de explosiones]|h|r afectan a los jugadores frente a Galliwyx.\n$bullet;Al morir, los técnicos de Fundisombras dejan caer unas gigabombas que activan |cFF2959D3|Hspell:1223905|h[¡Giga-BUM!]|h|r tras $1223905D. La |cFF2959D3|Hspell:469327|h[Gigaexplosión]|h|r de Gallywix las detona al instante.\n$bullet;Gallywix libera todos los |cFF2959D3|Hspell:1220290|h[Disparos trucados]|h|r al alcanzar $1220290s2 acumulaciones o al cambiar de objetivo principal.', 59888),
