(31173, 'esES', 'Intermedio: Atracado y cargado', 'Gallywix salta a la arena |cFF2959D3|Hspell:1214226|h[Haciendo un cráter]|h|r y aplasta a cualquiera que se cruce en su camino. Entonces, obtiene |cFF2959D3|Hspell:1214229|h[Blindaje apocalíptico]|h|r y lanza |cFF2959D3|Hspell:1214369|h[¡¡Destrucción total!!]|h|r hasta que lo interrumpen.', 59888),
