(30498, 'esES', 'Fase 1: ¡Menudo arsenal!', '\"Nadie va a esculpir tu cara en la ladera de una montaña si dejas que los demás te mangoneen\".\n\nGallywix ataca a sus enemigos con su arsenal mejorado.', 59888),
