(31120, 'esES', 'Sección 14', '', 59888),
(31118, 'esES', 'Sección 12', '$[!23\n\nEn dificultad mítica, Corrupción caótica aplica Vulnerabilidad caótica al jugador cuando se elimina.$]', 59888),
(28076, 'esES', 'Sección 10', '', 59888),
