(27861, 'esES', 'Sección 6', '', 59888),
(27557, 'esES', 'Sección 6', '', 59888),
(31956, 'esES', 'DPS', '$bullet;Las |cFF2959D3|Hspell:468846|h[Chispas Saltarinas]|h|r persiguen a los jugadores y los aturden al tocarlos.\n$bullet;El |cFF2959D3|Hspell:465279|h[Agua de presa]|h|r se electrifica al entrar en contacto con las facultades de relámpago de Geezle.\n$bullet;|cFF2959D3|Hspell:465463|h[Turbocarga]|h|r y |cFF2959D3|Hspell:468813|h[Gigachispa]|h|r infligen mucho daño.', 59888),
(31102, 'esES', 'Tanques', '$bullet;Rik usa |cFF2959D3|Hspell:466128|h[Resuena]|h|r para enviar potencia adicional a los amplificadores cercanos. \n$bullet; |cFF2959D3|Hspell:464488|h[Explosión sónica]|h|r inflige daño sónico en un cono frontal y aplica |cFF2959D3|Hspell:464518|h[Acúfenos]|h|r. El daño sónico no se puede bloquear ni reducir con armadura.\n$bullet;Los |cFF2959D3|Hspell:466722|h[Reventones]|h|r de los amplificadores lanzan a los jugadores por los aires mientras Rik genera letales |cFF2959D3|Hspell:467991|h[Caídas estridentes]|h|r.', 59888),
(30506, 'esES', 'Tanques', '$bullet;|cFF2959D3|Hspell:466518|h[Nudillos de oro fundido]|h|r inflige mucho daño frente a Mug y aplica |cFF2959D3|Hspell:467202|h[Goteo dorado]|h|r a los jugadores alcanzados.\n$bullet;El daño de |cFF2959D3|Hspell:469490|h[Tiro de hachazo doble]|h|r se mitiga contra el jugador alcanzado más cercano.', 59888),
(30486, 'esES', 'Resumen', 'Gallywix obtiene energía con el tiempo y activa las |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r de la Casa del Cromo a la máxima potencia. Las |cFF2959D3|Hspell:469362|h[Gigabombas cargadas]|h|r que se llevan a los gigacontroles activan una |cFF2959D3|Hspell:469767|h[Detonación de gigabomba]|h|r. Esto causa un |cFF2959D3|Hspell:1220846|h[Fallo de controles]|h|r que interrumpe las |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r de Gallywix. Tras perder ambos gigacontroles, se lanzará |cFF2959D3|Hspell:1215209|h[Sabotear zona]|h|r.\n\nAdemás, durante todo el encuentro, Gallywix invocará a los compinches de Fundisombras mejor pagados para ayudarlo.\n\nMientras la batalla prosigue, Gallywix altera y aumenta su arsenal para sembrar un caos maníaco.$[14,15,17$ Al alcanzar el 50% de su salud, Gallywix mejora sus capacidades para eliminar a los jugadores de una vez por todas. $]', 59888),
(30082, 'esES', 'Sanadores', '$bullet;Si no se depositan dos fichas o se detecta una combinación repetida durante |cFF2959D3|Hspell:461060|h[¡Gira para ganar!]|h|r, el bandido manco usará |cFF2959D3|Hspell:461068|h[¡Fraude detectado!]|h|r.\n$bullet;|cFF2959D3|Hspell:460164|h[Escape repugnante]|h|r reduce la velocidad de movimiento de todos los jugadores y absorbe una gran cantidad de sanación.\n$bullet;Al permanecer cerca de la ficha de |cFF2959D3|Hspell:460181|h[Línea de pago]|h|r, se obtiene |cFF2959D3|Hspell:460444|h[¡Apostador!]|h|r.', 59888),
(31381, 'esES', 'Sección 45', '', 59888),
(31380, 'esES', 'Sección 44', '', 59888),
(30951, 'esES', 'Sanadores', '$bullet;Las bombas de relojería que hacen tic tac creadas por |cFF2959D3|Hspell:460867|h[¡Gran badabum!]|h|r infligen mucho daño a todos los jugadores si se permite que se agoten.\n$bullet;|cFF2959D3|Hspell:459779|h[Carga arrolladora]|h|r hace que Bront atraviese cualquier objeto que haya en su camino, lo que incluye las bombas de relojería que hacen tic tac creadas por |cFF2959D3|Hspell:460867|h[¡Gran badabum!]|h|r\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[Gel explosivo cinético]|h|r lanza por los aires las bombas de relojería que hacen tic tac cercanas al disiparse.$]', 59888),
(30950, 'esES', 'Tanques', '$bullet;Las bombas de relojería que hacen tic tac creadas por |cFF2959D3|Hspell:460867|h[¡Gran badabum!]|h|r infligen mucho daño a todos los jugadores si se permite que se agoten.\n$bullet;|cFF2959D3|Hspell:459779|h[Carga arrolladora]|h|r hace que Bront atraviese cualquier objeto que haya en su camino, lo que incluye las bombas de relojería que hacen tic tac creadas por |cFF2959D3|Hspell:460867|h[¡Gran badabum!]|h|r.', 59888),
(30949, 'esES', 'DPS', '$bullet;Las bombas de relojería que hacen tic tac creadas por |cFF2959D3|Hspell:460867|h[¡Gran badabum!]|h|r infligen mucho daño a todos los jugadores si se permite que se agoten.\n$bullet;|cFF2959D3|Hspell:459779|h[Carga arrolladora]|h|r hace que Bront atraviese cualquier objeto que haya en su camino, lo que incluye las bombas de relojería que hacen tic tac creadas por |cFF2959D3|Hspell:460867|h[¡Gran badabum!]|h|r\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[Gel explosivo cinético]|h|r lanza por los aires las bombas de relojería que hacen tic tac cercanas al disiparse.$]', 59888),
