(31132, 'esES', 'DPS', '$bullet;Kul\'tharok desgarra las almas de los jugadores con |cFF2959D3|Hspell:473959|h[Extraer alma]|h|r. Kul\'tharok se imbuye de energía necrótica si las almas llegan a él, lo que activa |cFF2959D3|Hspell:474013|h[Corrupción de alma]|h|r.\n$bullet;|cFF2959D3|Hspell:1216474|h[Espiral de muerte]|h|r crea unos orbes de energía necrótica que infligen daño de las Sombras a los jugadores a los que tocan.', 59888),
(28414, 'esES', 'Resumen', 'El maestro cervecero Aldryr utiliza el poder explosivo de la Tragoceniza para atacar a los jugadores con |cFF2959D3|Hspell:432198|h[Eructo llameante]|h|r y |cFF2959D3|Hspell:432182|h[Lanzar Tragoceniza]|h|r.\n\nAl 66% y al 33% de salud, el maestro cervecero Aldryr da comienzo a la |cFF2959D3|Hspell:442525|h[Hora feliz]|h|r y hace que los clientes sedientos lancen un |cFF2959D3|Hspell:431896|h[Grito alborotador]|h|r.', 59888),
(22652, 'esES', 'DPS', '$bullet;|cFF2959D3|Hspell:333292|h[Muerte abrasadora]|h|r inflige daño a los aliados cercanos.\n$bullet;Al llegar a 100 p. de energía, Paceran ataca a los jugadores con |cFF2959D3|Hspell:320182|h[Esporas nocivas]|h|r.', 59888),
(22650, 'esES', 'Tanque', '$bullet;|cFF2959D3|Hspell:320069|h[Golpe mortal]|h|r reduce toda la sanación recibida.\n$bullet;Al llegar a 100 p. de energía, Paceran ataca a los jugadores con |cFF2959D3|Hspell:320182|h[Esporas nocivas]|h|r.', 59888),
