(21580, 'esES', 'DPS', '$bullet;Al ser derrotado, el contendiente otorga |cFF2959D3|Hspell:1215747|h[Última voluntad]|h|r al resto de contendientes.\n$bullet;|cFF2959D3|Hspell:333292|h[Muerte abrasadora]|h|r inflige daño a los aliados cercanos.\n$bullet;Al llegar a 100 p. de energía, Paceran ataca a los jugadores con |cFF2959D3|Hspell:320182|h[Esporas nocivas]|h|r.', 59888),
(21579, 'esES', 'Sanador', '$bullet;|cFF2959D3|Hspell:320069|h[Golpe mortal]|h|r reduce toda la sanación recibida.\n$bullet;|cFF2959D3|Hspell:333292|h[Muerte abrasadora]|h|r inflige daño a los aliados cercanos.\n$bullet;|cFF2959D3|Hspell:1215600|h[Toque marchitador]|h|r inflige daño de las Sombras de manera continua a los jugadores hasta que se disipa.', 59888),
(21577, 'esES', 'Resumen', 'Derrota a los tres contendientes para demostrar tu valía. Cada contendiente lanza una facultad poderosa cuando llega a 100 p. de energía.', 59888),
(19233, 'esES', 'Tanques', '$bullet;Lleva al repartetundas de platino dentro del alcance de los |cFF2959D3|Hspell:282943|h[machacapistones]|h|r para eliminar acumulaciones de |cFF2959D3|Hspell:282801|h[Blindaje de platino]|h|r.', 59888);
