INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2345, 'esES', 'Copete meeksi', '|cFFFFD200Tienda del juego|r|n', 'Los copetés son conocidos por sus tés aromáticos. Sin embargo, su naturaleza juguetona puede dar lugar a un montón de té derramado.', 59888),
(2344, 'esES', 'Patarrodante meeksi', '|cFFFFD200Tienda del juego|r|n', 'Los patarrodantes están muy orgullosos de su labor como portadores de té y siempre dispuestos a ofrecer una taza caliente a sus compañeros de viaje.', 59888),
(2343, 'esES', 'Patasuave meeksi', '|cFFFFD200Tienda del juego|r|n', 'Los patasuaves ofrecen un té negro ideal para tomar a primera hora de la mañana o para mantenerse despierto hasta bien entrada la noche.', 59888),
(2342, 'esES', 'Peloerizado meeksi', '|cFFFFD200Tienda del juego|r|n', 'Los peloerizados son criaturas juguetonas, torpes y obsesionadas con la limpieza. Una combinación de rasgos de lo más peligrosa.', 59888),
(2489, 'esES', 'Mariposa perlescente', '|cFFFFD200Puesto comercial|r', 'Surca los cielos a lomos de una mariposa brillante, reluciente y perlescente.', 59888),
(2288, 'esES', 'C.H.A.T.A.R.R.A.dor goblin personalizado', '|cFFFFD200Botín:|r Montón de chatarra revisado|n|cFFFFD200Zona:|r Minahonda', 'Las trituradoras goblins han demostrado en incontables ocasiones su utilidad en muchos trabajos, como la explotación forestal y el transporte. Este modelo ha sido reutilizado para C.H.A.T.A.R.R.A.', 59888),
(2346, 'esES', 'Ladrón de cerveza meeksi', '|cFFFFD200Tienda del juego|r|n', 'A pesar de su naturaleza veleidosa y juguetona, estas criaturas son unos compañeros de viaje leales y fiables.', 59888),
(2296, 'esES', 'Trotón de explorador de profundidades', '|cFFFFD200Misión del mundo: |rQuiero que me devuelvan el sombrero|n|cFFFFD200Zona: |rIsla de Dorn|n|cFFFFD200Zona: |rDornogal', 'Esta nave te ayudará a adentrarte en la aventura. ¡Al menos, si no explota antes!', 59888),
(2279, 'esES', 'Casquillo de tambor atronador', '|cFFFFD200Vendedor: |r\"Revólver\" Ando|n|cFFFFD200Zona: |rLiberación de Minahonda|n|cFFFFD200Coste: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Recuperado de las gradas de la Caldera durante un enfrentamiento especialmente espantoso. Cuando le preguntaron si era defectuoso, el operador de Torq solo respondió: \"Probablemente\".', 59888),
(2276, 'esES', 'Zampador de Fundisombras', '|cFFFFD200Vendedor: |r\"Revólver\" Ando|n|cFFFFD200Zona: |rLiberación de Minahonda|n|cFFFFD200Coste: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Considerado el mandamás de las hienas de desguace de Stix. Tiene suficiente potencia en las fauces como para aplastar cualquier cosa o persona de las que Gallywix quiera deshacerse.', 59888),
(1471, 'esES', 'Venganza', '|cFFFFD200Botín:|r Lady Sylvanas Brisaveloz|n|cFFFFD200Zona:|r Sagrario de Dominación|n|cFFFFD200Dificultad:|r Mítica', 'Sylvanas perdió una parte de sí misma el día que Arthas le quitó la vida, y la oscuridad de su interior ha crecido para llenar ese vacío.', 59888);
